import * as React from "react";
import {
  ListItem,
  ListItemIcon,
  Box,
  Drawer,
  Toolbar,
  List,
  Paper,
  IconButton,
  InputBase,
} from "@mui/material";
import SearchIcon from "@mui/icons-material/Search";

import Navbars from "../Navbar/navbarHome2.js";
// import IM from "../../Images/1.png";
import Article from "../../Images/Article.png";
import Novel from "../../Images/Novel.png";
import Submovie from "../../Images/Submovie.png";
import Treatise from "../../Images/Treatise.png";
import Essay from "../../Images/Essay.png";
import Other from "../../Images/Other.png";
import Birth from "../../Images/Birth.png";
import HouseRegistration from "../../Images/HouseRegistration.png";
import IdentificationCard from "../../Images/IdentificationCard.png";
import MarriageCertificate from "../../Images/MarriageCertificate.png";
import DivorceCertificate from "../../Images/DivorceCertificate.png";
import DivorceRegistration from "../../Images/DivorceRegistration.png";

// import Avatar7 from "../../Images/Avatar7.png";
// import Avatar8 from "../../Images/Avatar8.png";
// import Avatar9 from "../../Images/Avatar9.png";
// import Avatar10 from "../../Images/Avatar10.png";
// import Avatar11 from "../../Images/Avatar11.png";

import { FaHome, FaLanguage, FaShoppingCart } from "react-icons/fa";
import { IoDocumentText, IoIdCardSharp } from "react-icons/io5";
import { RiUserSearchFill } from "react-icons/ri";
import { IoChatbubblesSharp, IoNotifications } from "react-icons/io5";
// import { FiLogOut } from "react-icons/fi";
// import { fontSize } from "@mui/system";

const drawerWidth = 100;
export default function Home2() {
  //   const [value, setValue] = React.useState(4);
  const [type, setType] = React.useState(2);
  const { innerWidth: width } = window;

  return (
    <div className="App-body-home2">
      <header className="App-header">
        <Navbars />
      </header>
      <Box sx={{ display: "flex", width: "100% " }}>
        <Drawer
          variant="permanent"
          anchor="left"
          sx={{
            width: drawerWidth,
            [`& .MuiDrawer-paper`]: {
              width: drawerWidth,
              boxSizing: "border-box",
            },
          }}
          style={{ zIndex: 0, height: "100%" }}
        >
          <Toolbar />
          <Box sx={{ overflow: "hidden" }} className={"manu2"}>
            <List>
              {["1", "2", "3", "4", "5"].map((text, index) => (
                <ListItem button key={text} id={"button_manu"}>
                  <ListItemIcon id={"button_icons"}>
                    {index === 0 ? (
                      <FaHome className="icons" />
                    ) : index === 1 ? (
                      <FaLanguage className="icons" />
                    ) : index === 2 ? (
                      <FaShoppingCart className="icons" />
                    ) : index === 3 ? (
                      <IoChatbubblesSharp className="icons" />
                    ) : index === 4 ? (
                      <IoNotifications className="icons" />
                    ) : null}
                  </ListItemIcon>
                </ListItem>
              ))}
            </List>
          </Box>
        </Drawer>

        <Box component="main">
          <div style={{ marginTop: 60, height: 100 }}>
            <h4
              style={{
                fontWeight: 500,
                fontSize: 36,
                color: " #034D82",
                marginLeft: 20,
                position: "absolute",
                top: "13%",
              }}
            >
              HOME
            </h4>
            <Paper
              component="form"
              sx={{
                p: "2px 4px",
                display: "flex",
                alignItems: "center",
                width: 400,
                position: "absolute",
                left: "70%",
                top: "13%",
                borderRadius: 20,
                backgroundColor: "#FBFBFB",
                boxShadow: "none",
              }}
            >
              <IconButton
                type="submit"
                sx={{ p: "10px", color: "#034D82" }}
                aria-label="search"
              >
                <SearchIcon />
              </IconButton>
              <InputBase
                sx={{ ml: 1, flex: 1 }}
                placeholder="Search"
                inputProps={{ "aria-label": "search google maps" }}
              />
            </Paper>
          </div>
          <div style={{ position: "absolute", left: 178, marginTop: 20 }}>
            {type === 1 ? (
              <>
                <button
                  style={{
                    width: width * 0.2,
                    background: "#FFFFFF",
                    color: "#0082E0",
                    height: 210,
                    border: "1px solid #E5E5E5",
                    borderRadius: 20,
                    fontSize: 24,
                    fontWeight: 600,
                    marginRight: 70,
                  }}
                  onClick={() => setType(1)}
                >
                  <IoDocumentText style={{ width: "30%", height: "30%" }} />
                  <br />
                  <br />
                  General Document
                </button>

                <button
                  style={{
                    width: width * 0.2,
                    background: "#FFFFFF",
                    color: "#858585",
                    height: 210,
                    border: "1px solid #E5E5E5",
                    borderRadius: 20,
                    fontSize: 24,
                    fontWeight: 600,
                    marginRight: 70,
                  }}
                  onClick={() => setType(2)}
                >
                  <IoIdCardSharp style={{ width: "30%", height: "30%" }} />
                  <br />
                  <br />
                  Document offical
                </button>

                <button
                  style={{
                    width: width * 0.2,
                    background: "#FFFFFF",
                    color: "#858585",
                    height: 210,
                    border: "1px solid #E5E5E5",
                    borderRadius: 20,
                    fontSize: 24,
                    fontWeight: 600,
                    marginRight: 70,
                  }}
                  onClick={() => setType(3)}
                >
                  <RiUserSearchFill style={{ width: "30%", height: "30%" }} />
                  <br />
                  <br />
                  Find a Translator
                </button>

                <div
                  style={{
                    position: "absolute",
                    marginTop: 40,
                    display: "flex",
                    flexDirection: "row",
                    overflowX: "scroll",
                    maxWidth: "100%",
                  }}
                >
                  <div
                    style={{
                      background: "#FBFBFB",
                      width: 180,
                      height: 180,
                      color: "#0079CC",
                      float: "left",
                      borderRadius: 20,
                      fontSize: 15,
                      fontWeight: 500,
                      marginRight: 30,
                    }}
                  >
                    <div
                      style={{
                        background: "rgb(236 248 255)",
                        borderRadius: 20,
                        width: 150,
                        margin: 15,
                        padding: 15,
                      }}
                    >
                      <img
                        src={Article}
                        alt="Article"
                        style={{
                          marginBottom: 10,
                          height: "auto",
                          width: 60,
                        }}
                      />
                    </div>
                    <p>Article</p>
                  </div>

                  <div
                    style={{
                      background: "#FBFBFB",
                      width: 180,
                      height: 180,
                      color: "#0079CC",
                      float: "left",
                      borderRadius: 20,
                      fontSize: 15,
                      fontWeight: 500,
                      marginRight: 30,
                    }}
                  >
                    <div
                      style={{
                        background: "rgb(236 248 255)",
                        borderRadius: 20,
                        width: 150,
                        margin: 15,
                        padding: 15,
                      }}
                    >
                      <img
                        src={Novel}
                        alt="Novel"
                        style={{
                          marginBottom: 10,
                          height: "auto",
                          width: 90,
                        }}
                      />
